import Vue from 'vue'
Vue.component("Math", () => import("/Users/joshuabriley/go/personal/josh-vuepress/docs/.vuepress/components/Math.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-60010293f4c16",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/joshuabriley/go/personal/josh-vuepress/docs/README.md").then(comp => {
        Vue.component("v-60010293f4c16", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-52103c1bfa62a",
    path: "/about/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/joshuabriley/go/personal/josh-vuepress/docs/about/README.md").then(comp => {
        Vue.component("v-52103c1bfa62a", comp.default)
        next()
      })
    }
  },
  {
    path: "/about/index.html",
    redirect: "/about/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
